import React from "react";
import classes from "./Dialogs.module.css";
import { NavLink } from "react-router-dom";

function DialogItem(props) {
  return (
    <div className={classes.dialog}>
      <NavLink to={"/Dialogs/" + props.id}>{props.name}</NavLink>
    </div>
  );
}

function Message(props) {
  return <div className={classes.message}>{props.text}</div>;
}

function Dialogs() {
  let dialogsData = [
    { id: 0, name: "Jimmy" },
    { id: 1, name: "Bobby" },
    { id: 2, name: "Tommy" },
    { id: 3, name: "Katrin" },
    { id: 4, name: "Victoria" },
  ];

  let dialogsElements = dialogsData.map((dialogsData) => {
    <DialogItem name={dialogsData.name} id={dialogsData.id} />;
  });

  // [
  //   <DialogItem name={dialogsData[0].name} id={dialogsData[0].id} />,
  //   <DialogItem name={dialogsData[1].name} id={dialogsData[1].id} />,
  //   <DialogItem name={dialogsData[2].name} id={dialogsData[2].id} />,
  //   <DialogItem name={dialogsData[3].name} id={dialogsData[3].id} />,
  //   <DialogItem name={dialogsData[4].name} id={dialogsData[4].id} />,
  // ];

  let messagesData = [
    { id: 0, text: "HI!" },
    { id: 1, text: "nice" },
    { id: 2, text: "good" },
    { id: 3, text: "bye" },
    { id: 4, text: "lets start" },
  ];

  let messagesElements = [
    <Message text={messagesData[0].text} />,
    <Message text={messagesData[1].text} />,
    <Message text={messagesData[2].text} />,
  ];

  return (
    <div>
      <div className={classes.dialogs}>
        <div className={classes.dialogsItems}>{dialogsElements}</div>
        <div className={classes.messages}>{messagesElements}</div>
      </div>
    </div>
  );
}
export default Dialogs;
